import axiosApi from './axiosApi';

const movieApi = {
	getNowPlaying(apikey, page) {
		const url = `movie/now_playing?api_key=${apikey}&language=en-US&page=${page}`;
		return axiosApi.get(url);
	},
};

export default movieApi;
